html {
  box-sizing: border-box;
  font-size: 16px;
}

*,
*:after,
*:before {
  box-sizing: inherit;
}

.typography {
  font-size: 16px;
  -webkit-text-size-adjust: 100%;
  -moz-text-size-adjust: 100%;
  -ms-text-size-adjust: 100%;
  text-size-adjust: 100%;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif;
  word-wrap: break-word;
}

.typography * {
  line-height: 24px;
}

.typography blockquote, .typography details, .typography figure, .typography h1, .typography h2, .typography h3, .typography h4, .typography h5, .typography h6, .typography hr, .typography img, .typography ol, .typography p, .typography pre, .typography table, .typography ul {
  margin: 0px 0px 24px;
}

@media screen and (min-width: 640px) {
  .typography {
    font-size: 18px;
    -webkit-text-size-adjust: 112.5%;
    -moz-text-size-adjust: 112.5%;
    -ms-text-size-adjust: 112.5%;
    text-size-adjust: 112.5%;
  }
  .typography * {
    line-height: 28px;
  }
  .typography blockquote, .typography details, .typography figure, .typography h1, .typography h2, .typography h3, .typography h4, .typography h5, .typography h6, .typography hr, .typography img, .typography ol, .typography p, .typography pre, .typography table, .typography ul {
    margin: 0px 0px 28px;
  }
}

@media screen and (min-width: 1080px) {
  .typography {
    font-size: 20px;
    -webkit-text-size-adjust: 125%;
    -moz-text-size-adjust: 125%;
    -ms-text-size-adjust: 125%;
    text-size-adjust: 125%;
  }
  .typography * {
    line-height: 32px;
  }
  .typography blockquote, .typography details, .typography figure, .typography h1, .typography h2, .typography h3, .typography h4, .typography h5, .typography h6, .typography hr, .typography img, .typography ol, .typography p, .typography pre, .typography table, .typography ul {
    margin: 0px 0px 32px;
  }
}

.typography a:active, .typography a:hover {
  outline: 0;
}

.typography article {
  margin: 0 auto;
  padding: 0px 24px;
}

.typography article > * {
  max-width: 720px;
  margin-left: auto;
  margin-right: auto;
}

@media screen and (min-width: 640px) {
  .typography article {
    padding: 0px 28px;
  }
}

@media screen and (min-width: 1080px) {
  .typography article {
    padding: 0px 32px;
    max-width: 1080px;
  }
  .typography article .float-left,
  .typography article .float-right {
    max-width: 480px;
    padding: 0 42px;
  }
  .typography article .float-left {
    float: left;
  }
  .typography article .float-right {
    float: right;
  }
}

.typography pre,
.typography code,
.typography kbd,
.typography var,
.typography samp {
  font-family: monospace, monospace;
  padding: 0.1em 0.25em;
}

.typography pre {
  overflow: auto;
  word-wrap: normal;
  text-align: initial;
  padding: 24px;
}

@media screen and (min-width: 640px) {
  .typography pre {
    padding: 28px;
  }
}

@media screen and (min-width: 1080px) {
  .typography pre {
    padding: 32px;
  }
}

.typography pre code {
  display: block;
  background: none;
  color: inherit;
  border: 0;
  margin: 0;
  padding: 0;
}

.typography code,
.typography kbd,
.typography var,
.typography samp {
  vertical-align: bottom;
  font-size: 14.4px;
}

@media screen and (min-width: 640px) {
  .typography code,
  .typography kbd,
  .typography var,
  .typography samp {
    font-size: 16.2px;
  }
}

@media screen and (min-width: 1080px) {
  .typography code,
  .typography kbd,
  .typography var,
  .typography samp {
    font-size: 18px;
  }
}

.typography details {
  display: block;
}

.typography summary {
  display: block;
  margin-bottom: 12px;
}

@media screen and (min-width: 640px) {
  .typography summary {
    margin-bottom: 14px;
  }
}

@media screen and (min-width: 1080px) {
  .typography summary {
    margin-bottom: 16px;
  }
}

.typography figure {
  display: block;
}

.typography figcaption {
  display: block;
  text-align: center;
  font-size: 14px;
}

@media screen and (min-width: 640px) {
  .typography figcaption {
    font-size: 15.75px;
  }
}

@media screen and (min-width: 1080px) {
  .typography figcaption {
    font-size: 17.5px;
  }
}

.typography figcaption * {
  margin-bottom: 0;
}

.typography h1, .typography h2, .typography h3, .typography h4, .typography h5, .typography h6 {
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif;
}

.typography h1 {
  font-size: 39.99999988px;
  line-height: 60px;
  margin-top: 60px;
  margin-bottom: 36px;
}

.typography h2 {
  font-size: 33.30212822px;
  line-height: 36px;
  margin-top: 48px;
  margin-bottom: 24px;
}

.typography h3 {
  font-size: 27.72579368px;
  line-height: 36px;
  margin-top: 36px;
  margin-bottom: 24px;
}

.typography h4 {
  font-size: 23.08319847px;
  line-height: 24px;
  margin-top: 36px;
  margin-bottom: 24px;
}

.typography h5 {
  font-size: 19.21799093px;
  line-height: 24px;
  margin-top: 24px;
  margin-bottom: 12px;
}

.typography h6 {
  font-size: 16px;
  line-height: 24px;
  margin-top: 24px;
  margin-bottom: 12px;
}

@media screen and (min-width: 640px) {
  .typography h1 {
    font-size: 49.49999985px;
    line-height: 70px;
    margin-top: 70px;
    margin-bottom: 42px;
  }
  .typography h2 {
    font-size: 40.43325075px;
    line-height: 42px;
    margin-top: 56px;
    margin-bottom: 28px;
  }
  .typography h3 {
    font-size: 33.0272277px;
    line-height: 42px;
    margin-top: 42px;
    margin-bottom: 28px;
  }
  .typography h4 {
    font-size: 26.97774108px;
    line-height: 28px;
    margin-top: 42px;
    margin-bottom: 28px;
  }
  .typography h5 {
    font-size: 22.03631864px;
    line-height: 28px;
    margin-top: 28px;
    margin-bottom: 14px;
  }
  .typography h6 {
    font-size: 18px;
    line-height: 28px;
    margin-top: 28px;
    margin-bottom: 14px;
  }
}

@media screen and (min-width: 1080px) {
  .typography h1 {
    font-size: 59.99999982px;
    line-height: 80px;
    margin-top: 80px;
    margin-bottom: 48px;
  }
  .typography h2 {
    font-size: 48.16449359px;
    line-height: 48px;
    margin-top: 64px;
    margin-bottom: 32px;
  }
  .typography h3 {
    font-size: 38.66364083px;
    line-height: 48px;
    margin-top: 48px;
    margin-bottom: 32px;
  }
  .typography h4 {
    font-size: 31.03691144px;
    line-height: 32px;
    margin-top: 48px;
    margin-bottom: 32px;
  }
  .typography h5 {
    font-size: 24.91461878px;
    line-height: 32px;
    margin-top: 32px;
    margin-bottom: 16px;
  }
  .typography h6 {
    font-size: 20px;
    line-height: 32px;
    margin-top: 32px;
    margin-bottom: 16px;
  }
}

.typography h1 + h2,
.typography h2 + h3,
.typography h3 + h4,
.typography h4 + h5,
.typography h5 + h6 {
  margin-top: 0;
}

.typography hr {
  box-sizing: content-box;
  display: block;
  border: 0;
  height: 24px;
  margin: 48px auto;
  text-align: center;
}

.typography hr:before {
  content: "***";
  letter-spacing: 2em;
  margin-left: 2em;
}

@media screen and (min-width: 640px) {
  .typography hr {
    height: 28px;
    margin: 56px auto;
  }
}

@media screen and (min-width: 1080px) {
  .typography hr {
    height: 32px;
    margin: 64px auto;
  }
}

.typography img {
  display: block;
  max-width: 100%;
  margin-left: auto;
  margin-right: auto;
}

li > .typography ol, li >
.typography ul {
  margin: 0;
}

.typography blockquote {
  font-style: italic;
  padding-left: 24px;
}

.typography blockquote cite {
  display: block;
  text-align: right;
  font-size: 15px;
}

.typography figure blockquote {
  font-size: 22.4px;
  line-height: 36px;
  margin: 36px 0px;
}

.typography figure blockquote cite {
  font-size: 16px;
}

.typography figure blockquote * {
  line-height: inherit;
}

@media screen and (min-width: 640px) {
  .typography blockquote {
    padding-left: 28px;
  }
  .typography blockquote cite {
    font-size: 16.875px;
  }
  .typography figure blockquote {
    font-size: 25.2px;
    line-height: 42px;
    margin: 42px 0px;
  }
  .typography figure blockquote cite {
    font-size: 18px;
  }
}

@media screen and (min-width: 1080px) {
  .typography blockquote {
    padding-left: 32px;
  }
  .typography blockquote cite {
    font-size: 18.75px;
  }
  .float-left .typography blockquote,
  .float-right .typography blockquote {
    margin: 32px 0px;
  }
  .typography figure blockquote {
    font-size: 28px;
    line-height: 48px;
    margin: 48px 0px;
    padding-left: 0;
    text-align: center;
  }
  .typography figure blockquote cite {
    font-size: 20px;
    text-align: inherit;
  }
}

.typography table {
  border-collapse: collapse;
  border-spacing: 0;
}

.typography abbr {
  letter-spacing: 0.1em;
}

.typography abbr[title] {
  border-bottom: 1px dotted;
}

.typography b,
.typography strong {
  font-weight: bold;
}

.typography dfn {
  font-style: italic;
}

.typography em,
.typography i {
  line-height: 0;
  position: relative;
  vertical-align: baseline;
}

.typography mark {
  background: #ff0;
  color: #000;
}

.typography small {
  font-size: 70%;
  line-height: 12px;
}

@media screen and (min-width: 640px) {
  .typography small {
    line-height: 14px;
  }
}

@media screen and (min-width: 1080px) {
  .typography small {
    line-height: 16px;
  }
}

.typography sub,
.typography sup {
  font-size: 75%;
  line-height: 0;
  position: relative;
  vertical-align: baseline;
}

.typography sup {
  top: -0.5em;
}

.typography sub {
  bottom: -0.25em;
}

.typography .align-center {
  text-align: center;
}

.typography .align-left {
  text-align: left;
}

.typography .align-right {
  text-align: right;
}
